from typing import List


class Solution:
    def maxNonOverlapping(self, nums: List[int], target: int) -> int:
        cumulated_sum = [0]
        for num in nums:
            cumulated_sum.append(num + cumulated_sum[-1])

        candidates = []
        for length in range(1, len(nums) + 1):
            for start in range(len(nums) - length + 1):
                # if sum(nums[start:start + length]) == target:
                if cumulated_sum[start + length] - cumulated_sum[start] == target:
                    candidates.append((start, start + length - 1))

        # https://leetcode.com/discuss/interview-question/124824/find-maximum-nonoverlapping-intervals
        candidates.sort(key=lambda x: x[1])
        # print(candidates)

        totake = []
        for start, end in candidates:
            if not totake:
                totake.append((start, end))
                continue

            if start > totake[-1][1]:
                totake.append((start, end))

        return len(totake)

